import React from 'react';
import { connect } from 'react-redux';

import { menuChange } from '../../../actions';

class Forums extends React.Component {
    componentDidMount() {
        this.props.menuChange('forums');
    }

    render() {
        return <div className="Forums">Forums</div>;
    }
};

export default connect(null, {menuChange})(Forums);
